import React from 'react'
import Mainlayout from '../layout/mainlayout'


function Workshops() {
    function myFunction() {
        var element = document.getElementById("workshops");
        element.classList.add("active");
    }
    myFunction();
    return (
        <>
            <Mainlayout>
                <h1>this is my workshops page</h1>
            </Mainlayout>
        </>

    )
}

export default Workshops
